public static string Concatenate(int number)
{
    int count;
    System.Text.StringBuilder builder = new System.Text.StringBuilder("");
    for (count = 0; count < number; count++)
    {
         builder.Append("\n" + count.ToString());
    }
    return builder.ToString();
}
